export default function getTotalCount(filteredSearch, data, listToRender) {
  listToRender.forEach(e => {
      data['display'][e.toLowerCase()]['total'] = Math.ceil(filteredSearch[e.toLowerCase()]['results'].length/100)
  })
  return data
}
